import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

export default function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/lists">List</Link>
            </li>
            <li>
              <Link to="/">Login</Link>
            </li>
          </ul>
        </nav>


        <Switch>
          <Route path="/lists" exact component={List} />
          <Route path="/login" exact component={Login} />
          <Route path="/">
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

